import { css } from '@emotion/css'
import { X } from 'react-feather'



function Chip(props) {
    return (
        <div className={css`display: flex; gap: 10; align-items: center; padding: 10px; border-radius:40px; font-size:14px; background-color: ${props.color}`} >
                {props.text}

            {
                props.close && <X  onClick={props.onClose} />
            }


        </div>
    )
}

export default Chip
